  true,\n\t\"url\": null,\n\t\"notes\": \"This area of the website provides information
  on three of the safety programs established by FMCSA to support this mission.  The
  three programs covered by this area include reviews, roadside inspections of commercial
  vehicles and drivers, and traffic enforcement stops of CMVs operating in an unsafe
  manner. Each program is implemented in conjunction with the states and devoted to
  improving motor carrier safety by reducing the number and severity of crashes involving
  large trucks and buses.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
